import {Avatar, Layout} from 'antd';
import qoobee from "../../images/qoobee.jpg";
const {
    Header, Footer, Sider, Content,
} = Layout;

const headerStyle = {
    height:'100px', backgroundColor:'white',borderBottom: '1px solid #ebebe0 '
}

const footerStyle = {
    height:'80px', backgroundColor:'white',borderTop: '1px solid #ebebe0 '
}

class Message extends Component {

    render() {
        return (
            <Layout>
            <Header style={headerStyle}>
                <Avatar  size={100} src={qoobee} style={{margin:'10px 5px 10px 5px'}}/>
            </Header>,

            <Content>
            </Content>,

            <Footer style={footerStyle}>
            </Footer >

            </Layout>
        );
    }
}
export default Message;
